	'Perl 5.6 and earlier used a quicksort algorithm to implement sort. That algorithm was not stable, so could go quadratic. (A stable sort preserves the input order of elements that compare equal. Although quicksort\'s run time is O(NlogN) when averaged over all arrays of length N, the time can be O(N**2), quadratic behavior, for some inputs.) In 5.7, the quicksort implementation was replaced with a stable mergesort algorithm whose worst-case behavior is O(NlogN). But benchmarks indicated that for some inputs, on some platforms, the original quicksort was faster. 5.8 has a sort pragma for limited control of the sort. Its rather blunt control of the underlying algorithm may not persist into future Perls, but the ability to characterize the input or output in implementation independent ways quite probably will. See the sort pragma.'	=> 'Perl 5.6 и более ранние версии использовали алгоритм быстрой сортировки для реализации подобного. Этот алгоритм не была стабильной, так что могли бы пойти квадратичной. (Сортировке сохраняется порядок ввода элементов, которые считаются равными. Хотя время выполнения быстрой сортировки составляет O (NlogN), когда усредненная по всем массивов длины N, время может быть O (N ** 2), квадратичной поведения, для некоторых входов .) в 5,7, реализация быстрой сортировки был заменен на устойчивый алгоритм сортировки слиянием которых наихудшее поведение O (NlogN). Но тесты показали, что для некоторых входов, на некоторых платформах, оригинальный быстрой сортировки был быстрее. 5.8 есть своего рода Pragma для ограниченный контроль в этом роде. Его довольно тупым полный контроль основного алгоритма не может сохраниться и в будущем Перлз, но способность характеризуют вход или выход в выполнении независимых способов вполне вероятно, будет. Видеть рода Pragma.',
